using System;
using System.Collections.Generic;

namespace MassFindAndReplace
{
    class Program
    {
        static void Main(string[] args)
        {
            var replacements = BuildReplacements();
            var codeReplcements = GetCode();

            foreach (var codeReplcement in codeReplcements)
            {
                var replaced = Replace(codeReplcement.Code, replacements);

                System.IO.File.WriteAllText(@"C:\Temp\" + codeReplcement.Name + ".txt", replaced);
            }
        }

        public static List<Replacement> BuildReplacements()
        {
            var replacements = new List<Replacement>();
            var lines = GetInput().Split(new string[] {"\r\n"}, StringSplitOptions.RemoveEmptyEntries);

            foreach (var line in lines)
            {
                var parts = line.Split(new string[] { " ", "\t" }, StringSplitOptions.RemoveEmptyEntries);

                if (parts.Length >= 2)
                {
                    replacements.Add(new Replacement()
                    {
                        Find = parts[0].Trim(),
                        Replace = parts[1].Trim()
                    });
                }
            }

            return replacements;
        }

        public static string Replace(string code, List<Replacement> replacements)
        {
            foreach (var replacement in replacements)
                code = code.Replace(replacement.Find, replacement.Replace);

            return code;
        }

